from dataclasses import dataclass
from typing import TypedDict, Union

from stw_gen_sample3_api.basic_types import *
from stw_py_api_runtime.gen_classes.telemetry.parse import Message as _Message




@dataclass
class StackSize(_Message):

    # Счетчик overflow
    counter: uint32_t
    # Текущий размер стека задачи
    allowedSize: uint32_t


class StackSizeDict(TypedDict):

    # Счетчик overflow
    counter: Union[uint32_t, int ]

    # Текущий размер стека задачи
    allowedSize: Union[uint32_t, int ]

